1986 ; 
De Rhodes à Samarkand, Corto sur la route de la soie ; 
couverture souple. 
Pages numérotées de 5 à 142.
Quelques taches sur la tranche

Fermoir  de sac en bois. 
dimensions d'ouverture 24x6 cm; 
dimension extérieur 29x30 cm.

Bracelet original , en textile appliqué sur forme carré rigide. 
Coloris rose, violet, orange et argenté. 
Diamètre 6,3 cm; Largeur 2,5 cm;

Tout Simenon Tome 5 aux éditions Presses de la Cité. 
Il comprend :
Le temps d'Anaïs ; 
Un Noël de Maigret ; 
Sept petites croix dans un carnet ; 
Le petit restaurant des Ternes ; 
Maigret au Picratt's , 
Maigret en meublé ; 
Une vie comme neuve ; 
Maigret et la Grande Perche ; 
Marie qui louche ; 
Maigret, Lognon et les gangsters.
Bon état, traces d'utilisation.

Oeuvres de francois coppée  1872-1878
Le Reliquaire, Poèmes divers, Intimité, Poèmes modernes;
La Grève des Forgerons, les Humbles écrit pendant le siège;
Plus de sang. Promenades et intérieurs;
paris, éditeur alphonse Lemerre, M.DCCC.LXXXIII (1883).
377 pages  protégées par des serpentes (papier fin de protection contre les macules) par E. Boilvin
Intérieure en bon état ,couverture en état moyen si non en bon état dans l'ensemble.

Echarpe neuve Monoprix à grands carreaux  marine et beige ; 
Bords frangés. 
De grande dimensions 102 cm x 198 cm, c'est une écharpe homme que vous pourrez emprunter mesdames  pour apprécier sa douceur et sa chaleur.

Tout Simenon Tome 3 aux éditions Presses de la Cité. 
Il comprend :
Les vacances de Maigret ; 
La neige était sale ; 
Le fond de la bouteille ; 
La première enquête de Maigret ; 
Les fantômes du chapelier ; 
Mon ami Maigret ; 
Les quatre jours  du pauvre homme ; 
Maigret chez le coroner. 
Bon état, traces d'utilisation.

Tout Simenon Tome 4 aux éditions Presses de la Cité. 
Il comprend :
Un nouveau dans la ville ; 
Maigret et la vieille dame ; 
L'amie de Madame Maigret ; 
L'enterrement de  Monsieur Bouvet ; 
Maigret et les petits cochons sans queue ; 
Les volets verts ; Tante Jeanne ; 
Les mémoires de Maigret. 
Bon état, traces d'utilisation.

